import React from 'react'

import './map.scss'

interface MapProps {
    className?: string;
    style?: object;
    coordinates:{
        lat:number;
        lng:number;
    }
}

export const Map:React.FC<MapProps>   = (
    {
        className,
        style,
        coordinates
    }
) => {
  return (
    <div className={`map ${className}`} style={style}>
         <iframe    title="map" width="100%" height="100%" 
                    frameBorder="0" scrolling="no" marginHeight={0} marginWidth={0}
                    src={`https://maps.google.com/maps?q=
                        ${coordinates.lat.toString()},${coordinates.lng.toString()}
                        &t=&z=15&ie=UTF8&iwloc=&output=embed`}>
        </iframe>
        <script type='text/javascript' 
        src='https://embedmaps.com/google-maps-authorization/script.js?id=5a33be79e53caf0a07dfec499abf84b7b481f165'></script>
    </div>
  )
}
